bool placementValid(int playerNum, Ship thisShip)
{
    if (playerNum == 1)
        return placementValid1(thisShip);
    else
        return placementValid2(thisShip);
}

bool placementValid1(Ship thisShip)
{
    int numSegs = thisShip.type;

    //Iterates through segments and checks if there is another segment at that position
    for (int seg = 0; seg < numSegs; seg++)
    {
        if (SegmentHitSetup(thisShip.Segments[seg].X, thisShip.Segments[seg].Y, 1) != NULL)
        {
            return 0;
        }
    }
    return 1;
}

bool placementValid2(Ship thisShip)
{
    int numSegs = thisShip.type;

    for (int seg = 0; seg < numSegs; seg++)
    {
        if (SegmentHitSetup(thisShip.Segments[seg].X, thisShip.Segments[seg].Y, 2) != NULL)
        {
            return 0;
        }
    }
    return 1;
}

Ship selectShip(int shipNum, int playerNum)
{
    if (shipNum == 0)
    {
        Ship result = Carrier;
        if (playerNum == 1)
            result.Segments = player1Segs[shipNum];
        if (playerNum == 2)
            result.Segments = player2Segs[shipNum];
        return result;
    }
    else if (shipNum == 1)
    {
        Ship result = Battleship;
        if (playerNum == 1)
            result.Segments = player1Segs[shipNum];
        if (playerNum == 2)
            result.Segments = player2Segs[shipNum];
        return result;
    }
    else if (shipNum == 2)
    {
        Ship result = Destroyer;
        if (playerNum == 1)
            result.Segments = player1Segs[shipNum];
        if (playerNum == 2)
            result.Segments = player2Segs[shipNum];
        return result;
    }
    else if (shipNum == 3)
    {
        Ship result = Submarine;
        if (playerNum == 1)
            result.Segments = player1Segs[shipNum];
        if (playerNum == 2)
            result.Segments = player2Segs[shipNum];
        return result;
    }
    else
    {
        Ship result = PatrolBoat;
        if (playerNum == 1)
            result.Segments = player1Segs[shipNum];
        if (playerNum == 2)
            result.Segments = player2Segs[shipNum];
        return result;
    }
}
