//Draws Cursor on specified square
void DrawCursor(int gridx, int gridy)
{
    //gets top left pixel position
    int x0 = GRID_BASE_X + gridx * DIST_NEXT;
    int y0 = gridy * DIST_NEXT;

    //Draws the 4 line segments
    if (y0 > 0)
    {                                                    //GUARD AGAINST DRAWING OUT OF BOUANDS
        draw_line(x0 - 2, y0 - 1, 22 + x0, y0 - 1, RED); // top
    }
    draw_line(x0 - 2, 23 + y0, 22 + x0, 23 + y0, RED);   // bot
    draw_line(x0 - 2, y0, x0 - 2, GRID_WIDTH + y0, RED); // left
    draw_line(22 + x0, y0, 22 + x0, 22 + y0, RED);       // right
}

Coord ChooseHitPlacement(int x_start, int y_start)
{

    DrawCursor(x_start, y_start);

    while (1)
    {
        char key = WaitForButtonPress();

        //Waits for valid key press and checks bounds
        if (key == 'X') //FIRE
        {
            break;
        }
        if (key == '>') //RIGHT
        {               //Right
            x_start++;
            if (!inBounds(x_start, y_start))
                x_start--;
        }
        else if (key == '<') //LEFT
        {                    //LEFT
            x_start--;
            if (!inBounds(x_start, y_start))
                x_start++;
        }
        else if (key == '^') //UP
        {                    //UP
            y_start--;
            if (!inBounds(x_start, y_start))
                y_start++;
        }
        else if (key == 'v') //DOWN
        {                    //DOWN
            y_start++;
            if (!inBounds(x_start, y_start))
                y_start--;
        }

        //Removes old cursor and draws new one
        DrawGrid();
        DrawCursor(x_start, y_start);
    }

    //Returns selected position
    Coord placement = {x_start, y_start};
    return placement;
}

Coord randPlacement()
{ //Returns random coordianted between 0-9
    Coord shot = {rand() % 10, rand() % 10};
    return shot;
}

char WaitForButtonPress()
{
    volatile int *key_ptr = (int *)KEY_BASE;
    volatile int *sw_ptr = (int *)SW_BASE;

    *(key_ptr + 2) = 0xF;
    *(key_ptr + 3) = 0xF;

    int key_val = *(key_ptr + 3);
    int sw_val = 0;
    bool upDown = 0;
    bool upDown2 = 0;

    //While No Key pressed:
    while (key_val == 0)
    {
        key_val = *(key_ptr + 3);
        sw_val = *(sw_ptr);

        //Check SW0
        if ((sw_val & 0x1) == 1)
        {
            upDown = 1;
        }
        else if (upDown)
        {
            return 'X';
        }

        //Check SW 1
        if ((sw_val & 0x2) == 2)
        {
            upDown2 = 1;
        }
        else if (upDown2)
        {
            return 'r';
        }
    }

    //Checks which key was pressed (NOTE GUARD FOR ALL PRESSED AT ONCE)
    if ((key_val & 1) == 1) //KEY0
    {                       //DOWN
        return 'v';
    }
    else if ((key_val & 0b10) == 2) //KEY1
    {                               //UP
        return '^';
    }
    else if ((key_val & 0b100) == 4) //KEY2
    {                                //RIGHT
        return '>';
    }
    else if ((key_val & 0b1000) == 8) //KEY3
    {                                 //LEFT
        return '<';
    }
    //L => Unknown Press
    return 'L';
}

