bool inBounds(int x, int y)
{

    //Checks if x and Y are in grid bound (0-9)
    if ((x >= 0 && x < 10) && (y >= 0 && y < 10))
    {
        return 1;
    }
    else
    {
        return 0;
    }
}

void DrawWordLine(char *cs, int lineY, int x)
{
    //Writes to text buffer at Y value and starts at x value
    int offset = (lineY << 7) + x;
    while (*(cs))
    {
        *(char_buffer_start + offset) = *(cs); // write to the character buffer
        cs++;
        offset++;
    }
}

void clearText()
{
    //Clears all text in text buffer
    int offset = 0;
    for (int pixelNum = 0; pixelNum < 4800; pixelNum++)
    {
        *(char_buffer_start + offset) = 0; // Clear spot
        offset++;
    }
}

bool takeTurn(int currPlayer)
{

    bool hit = 0;
    Coord shot;
    if (currPlayer == 1)
    {
        shot = ChooseHitPlacement(5, 5);

        while (Player2GameBoard[shot.x][shot.y] != 0)
        {
            //Check if position has already been guessed
            shot = ChooseHitPlacement(shot.x, shot.y);
        }
        //Update player's gameboard to hit value (1 = miss, 2 = hit)
        Player2GameBoard[shot.x][shot.y] = hitType(shot.x, shot.y, currPlayer);

        //Display type of hit
        if (Player2GameBoard[shot.x][shot.y] == 1)
        {
            DrawWordLine("Miss", 5, 0);
        }
        else
        {
            DrawWordLine("HIT!", 5, 0);
            hit = 1;
        }
        //Update sunk flag and dislayed hit
        updateSunkFlag(1);
        DrawCursor(shot.x, shot.y);
        drawHits_Miss(1);
        drawPreview(1);

        //Flash cursor on selected position
        for (int i = 0; i < 3; i++)
        {
            DrawGrid();
            WaitForTime(0.5, 0);
            DrawCursor(shot.x, shot.y);
            WaitForTime(0.5, 0);
        }
    }
    else
    {
        if (TwoPlayers)
        { //SECOND PLAYER
            shot = ChooseHitPlacement(5, 5);

            //While position already guessed ask for new position
            while (Player1GameBoard[shot.x][shot.y] != 0)
            {
                //Check if position has already been guessed
                shot = ChooseHitPlacement(shot.x, shot.y);
            }
        }
        else
        { //COMPUTER
            do
            { //Generate Guess
                shot = randPlacement();
            } while (Player1GameBoard[shot.x][shot.y] != 0); // Check if position alreadt guessed
        }

        //Position not guessed => update gameboard with hit type
        Player1GameBoard[shot.x][shot.y] = hitType(shot.x, shot.y, currPlayer);

        //Display hit or miss
        if (Player1GameBoard[shot.x][shot.y] == 1)
        {
            DrawWordLine("Miss", 5, 0);
        }
        else
        {
            DrawWordLine("HIT!", 5, 0);
            hit = 1;
        }

        //Update sunk flag and hits displayed
        updateSunkFlag(2);
        DrawCursor(shot.x, shot.y);
        drawHits_Miss(2);
        drawPreview(2);

        //Flash cursor on selected position
        for (int i = 0; i < 3; i++)
        {
            DrawGrid();
            WaitForTime(0.5, 0);
            DrawCursor(shot.x, shot.y);
            WaitForTime(0.5, 0);
        }
    }
    //Return is hit was sucessful
    return hit;
}

int hitType(int x, int y, int currPlayer)
{
    //Get hit segment
    ShipSegment *hitSeg = SegmentHit(x, y, currPlayer);
    //If null => NO SEGMENT HIT
    if (hitSeg == NULL)
    {
        return 1;
    }
    //Set hit flag of segment to 1 and return 2
    hitSeg->hit = 1;
    return 2;
}

ShipSegment *SegmentHit(int x, int y, int currPlayer)
{
    //Iterates through all the ships
    for (int shipNum = 0; shipNum < 5; shipNum++)
    {

        //sets ship to enemy ships
        Ship s = (currPlayer == 2) ? Player1Ships[shipNum] : Player2Ships[shipNum];
        //finds number of segments
        int n = s.type;
        //Iterates through segments checking the x and y position
        for (int i = 0; i < n; i++)
        {
            if (s.Segments[i].X == x && s.Segments[i].Y == y)
            { //HIT!
                bool Sunk = 1;
                for (int sCheck = 0; sCheck < n; sCheck++)
                {
                    if (sCheck != i && s.Segments[sCheck].hit == 0)
                    {
                        Sunk = 0;
                        break;
                    }
                }

                if (Sunk)
                    DrawWordLine("SUNK!", 3, 0);
                return &s.Segments[i];
            }
        }
    }
    //Does not belong to any ships
    return NULL;
}

ShipSegment *SegmentHitSetup(int x, int y, int currPlayer)
{
    int numShips = (currPlayer == 1) ? numShipsPlaced1 : numShipsPlaced2;
    //Iterates through all the ships
    for (int shipNum = 0; shipNum < numShips; shipNum++)
    {

        //sets ship to enemy ships
        Ship s = (currPlayer == 1) ? Player1Ships[shipNum] : Player2Ships[shipNum];
        //finds number of segments
        int n = s.type;
        //Iterates through segments checking the x and y position
        for (int i = 0; i < n; i++)
        {
            if (s.Segments[i].X == x && s.Segments[i].Y == y)
            { //HIT!
                return &s.Segments[i];
            }
        }
    }
    //Does not belong to any ships
    return NULL;
}

void updateSunkFlag(int currPlayer)
{
    //Iterates through each ship
    for (int shipNum = 0; shipNum < 5; shipNum++)
    {

        //sets ship to enemy ships
        Ship s = (currPlayer == 2) ? Player1Ships[shipNum] : Player2Ships[shipNum];
        int n = s.type;

        bool shipSank = 1;
        //Iterate through all segments
        for (int i = 0; i < n; i++)
        {
            if (s.Segments[i].hit == 0) //If a segment wasn't hit
            {                           //NOT SANK
                shipSank = 0;
                break;
            }
        }

        s.sunk = shipSank;
    }
    return;
}

int playGame()
{
    bool gameOver;
    gameOver = (skipToEnd) ? 1 : 0;

    int winningPlayer;
    winningPlayer = (skipToEnd) ? 1 : 0;
    P1_score = P2_score = 0;

    //set player scores on hex to 0
    drawHex2Dig(1, 0);
    drawHex2Dig(3, 0);

    while (!gameOver)
    {
        clearText();
        ClearBoard();

        //Draw grid for Player 1
        DrawWordLine("P1 Turn", 0, 0);
        DrawWordLine("KEYS - Move Cursor", 8, 0);
        DrawWordLine("SW0 - Fire!", 10, 0);

        if (debug)
        {
            drawAllPlacedShips(2); //DEBUGGING
        }

        //Draw preview of player 2's ships
        drawPreview(1);
        drawHits_Miss(1);
        //PLayer 1 guesses
        if (takeTurn(1))
        {
            P1_score++;
            drawShipBlowPattern();
            drawHex2Dig(3, P1_score);
            if (P1_score == 17)
            {
                gameOver = 1;
                winningPlayer = 1;
                break;
            }
        } //PLayer 1s turn

        //Update hits and misses
        drawHits_Miss(1);
        drawPreview(1);

        //DELAY BEFORE PLAYER 2 Turn
        if (TwoPlayers)
        {
            clearText();
            drawTransitionTo(2);
            WaitForTime(10, 1);
            clear_screen();
        }
        else
        {
            WaitForTime(2, 0);
        }

        DrawGrid();
        ClearBoard();
        clearText();

        //Draw grid for Player 2
        DrawWordLine("P2 Turn", 0, 0);
        DrawWordLine("KEYS - Move Cursor", 8, 0);
        DrawWordLine("SW0 - Fire!", 10, 0);

        if (!TwoPlayers || debug)
        {
            drawAllPlacedShips(1);
        }
        drawPreview(2);
        drawHits_Miss(2);
        if (takeTurn(2))
        {
            P2_score++;
            drawShipBlowPattern();
            drawHex2Dig(1, P2_score);

            if (P2_score == 17)
            {
                gameOver = 1;
                winningPlayer = 2;
            }
        } //P2 turn

        //If two players draw transition slide
        if (TwoPlayers)
        {
            clearText();
            drawTransitionTo(1);
            WaitForTime(10, 1);
            clear_screen();
        }
        DrawGrid();
    }

    //GameOver!
    if (winningPlayer == 2)
    {
        clearText();
        ClearBoard();
        //Draw grid for Player 1
        DrawWordLine("P2 WINS", 0, 0);

        drawAllPlacedShips(2); //DEBUGGING

        //Draw preview of player 2's ships
        drawPreview(1);
        drawHits_Miss(1);
    }
    else
    {
        clearText();
        ClearBoard();
        //Draw grid for Player 1
        DrawWordLine("P1 WINS!!", 0, 0);

        drawAllPlacedShips(1); //DEBUGGING

        //Draw preview of player 2's ships
        drawPreview(2);
        drawHits_Miss(2);
    }
    DrawWordLine("PRESS ANY KEY", 2, 0);
    DrawWordLine("TO CONTINUE", 3, 0);
    WaitForButtonPress();

    clearText();
    drawWinScreen(winningPlayer);

    return winningPlayer;
}

void drawShipPreview()
{
    //Draws ships based on preloaded locations
    int numSegs = 5;
    drawRectangle(previewCoords[0].x, previewCoords[0].y, previewCoords[0].x + previewWidth, previewCoords[0].y + numSegs * previewWidth, BLUE);
    numSegs = 4;
    drawRectangle(previewCoords[1].x, previewCoords[1].y, previewCoords[1].x + previewWidth, previewCoords[1].y + numSegs * previewWidth, GREEN);
    numSegs = 3;
    drawRectangle(previewCoords[2].x, previewCoords[2].y, previewCoords[2].x + previewWidth, previewCoords[2].y + numSegs * previewWidth, CYAN);
    drawRectangle(previewCoords[3].x, previewCoords[3].y, previewCoords[3].x + previewWidth, previewCoords[3].y + numSegs * previewWidth, MAGENTA);
    numSegs = 2;
    drawRectangle(previewCoords[4].x, previewCoords[4].y, previewCoords[4].x + previewWidth, previewCoords[4].y + numSegs * previewWidth, GREY);
}

void drawRectangle(int x0, int y0, int x1, int y1, short int colour)
{
    //Iterates through x positions and draws line from y0 to y1
    for (int dx = 0; dx < x1 - x0; dx++)
    {
        draw_line(x0 + dx, y0, x0 + dx, y1, colour);
    }
}

void drawPreviewHit(int shipNum, int segNum)
{
    //Draws a red x over the specifed segment of the specified ship number
    int x = previewCoords[shipNum].x;
    int y = previewCoords[shipNum].y;

    draw_line(x, y + previewWidth * segNum, x + previewWidth - 1, y + previewWidth * (segNum + 1), RED);
    draw_line(x, y + previewWidth * (segNum + 1), x + previewWidth - 1, y + previewWidth * segNum, RED);
}

void drawPreview(int currPlayer)
{
    DrawWordLine("--- Ship Status --- ", 14, 0);
    //Draws small empty ship outlines bottom left
    drawShipPreview();

    //Iterates through all ships and draws hit previews
    for (int shipNum = 0; shipNum < 5; shipNum++)
    { //Get ship struct and length
        Ship s = (currPlayer == 2) ? Player1Ships[shipNum] : Player2Ships[shipNum];
        int n = s.type;

        //Iterate through each segment checking if it's hit
        for (int i = 0; i < n; i++)
        {
            if (s.Segments[i].hit == 1) // if hit draw hit preview
            {
                drawPreviewHit(shipNum, i);
            }
        }
    }
}

void drawHits_Miss(int currPlayer)
{

    //Iterates through each players game board and draws all misses and hits
    for (int x = 0; x < 10; x++)
    {
        for (int y = 0; y < 10; y++)
        {
            if (currPlayer == 1)
            {
                if (Player2GameBoard[x][y] == 1) // 1 => Missed
                {
                    drawMiss(x, y);
                }
                else if (Player2GameBoard[x][y] == 2) // 2 => HIT
                {
                    drawHit(x, y);
                }
            }
            else
            {
                if (Player1GameBoard[x][y] == 1) // 1 => Missed
                {
                    drawMiss(x, y);
                }
                else if (Player1GameBoard[x][y] == 2) // 2 => HIT
                {
                    drawHit(x, y);
                }
            }
        }
    }
}

int WaitForTime(double seconds, bool display)
{
    //Clock speed -> 200 MHz
    int clkSpeed = 200000000;
    //Set up base pointers
    int *loadPtr = (int *)TIMER_BASE;
    int *controlPtr = (int *)(TIMER_BASE + 0x8);
    int *interruptPtr = (int *)(TIMER_BASE + 0xc);

    //Load timer value
    int counterVal = seconds * clkSpeed;
    *loadPtr = counterVal;

    *controlPtr = 0x5;   //Starts timer
    *interruptPtr = 0x1; //Resets F bit
    int F = *interruptPtr & 0x1;

    while (F == 1) // Check if interrupt bit is a 0
    {
        F = *interruptPtr & 0x1;

        //loads remainging time in seconds into hex display
        int curVal = *(loadPtr + 1) / clkSpeed;
        if (display)
            drawHex2Dig(5, curVal);
        //*led_ptr = F;
    }

    while (F == 0) // Check if interrupt bit is a 0
    {
        F = *interruptPtr & 0x1;
        //loads remainging time in seconds into hex display
        int curVal = *(loadPtr + 1) / clkSpeed;
        if (display)
            drawHex2Dig(5, curVal);
        //*led_ptr = F;
    }
    return 1;
}

bool isAllShipsSunk(int currPlayer)
{
    //Checks if all ships have been sunk and returns bool
    bool allSunk = 1;
    //iterate through all ships
    for (int i = 0; i < 5; i++)
    {
        Ship s = (currPlayer == 1) ? Player2Ships[i] : Player1Ships[i];
        if (s.sunk == 0)
        {
            allSunk = 0;
            break;
        }
    }

    return allSunk;
}

void drawHex2Dig(int startHex, int val)
{

    //Check if one digit
    if (val < 9)
    {
        drawHex(startHex - 1, val);
        drawHex(startHex, -1);
        return;
    }

    //Check if 2 digits
    if (val > 9 && val < 100)
    {
        int ones = val % 10;
        int tens = val / 10;

        drawHex(startHex - 1, ones);
        drawHex(startHex, tens);
    }

    //Check if more than 3 digits
    if (val > 100)
    {
        int ones = val % 10;
        int tens = (val / 10) % 10;
        drawHex(startHex - 1, ones);
        drawHex(startHex, tens);
    }
}

