int selectGameMode()
{
    volatile int *sw_ptr = (int *)SW_BASE;

    int sw_val = 0;

    //Bools for if a sw has gone from 1 to 0
    bool upDown0 = 0;
    bool upDown1 = 0;
    bool upDown9 = 0;
    bool upDown8 = 0;

    while (1)
    {
        //Get Switch values
        sw_val = *(sw_ptr);

        //Check SW0
        if ((sw_val & 0x1) == 1)
        {
            upDown0 = 1;
        }
        else if (upDown0)
        {
            return 0;
        }

        //Check SW1
        if ((sw_val & 0b10) == 2)
        {
            upDown1 = 1;
        }
        else if (upDown1)
        {
            return 1;
        }

        //CHECK SW8
        if ((sw_val & 0b100000000) == 256)
        {
            upDown8 = 1;
        }
        else if (upDown8)
        {
            skipToEnd = 1;
        }

        //CHECK SW9
        if ((sw_val & 0b1000000000) == 512)
        {
            upDown9 = 1;
        }
        else if (upDown9)
        {
            debug = 1;
        }
    }
}

